    $templateCache.put("/partials/views/legal-advice/legal-advice.html", "<div class=\"page-content page-content--legal-advice\"><div class=\"advice-section advice-section--intro\"><div class=\"advice-section__inner\"><h1>Legal Advice</h1><p>We know buying or selling a property can be one of the most stressful times in your life. Fear not though, as were ready and waiting to help you through the process. From start to finish, well make sure your homebuying journey is as smooth as possible.</p></div></div><accordion class=\"advice__sections\" data-close-others=\"false\"><div class=\"advice-section\"><div class=\"advice-section__inner\"><div class=\"advice__section\"><div class=\"accordion-heading\"><h3>What is conveyancing?</h3></div><div class=\"accordion-body\"><div class=\"accordion-inner\"><p>Conveyancing is a legal service provided by licensed practitioners that deals with the buying and selling of land and property titles. The main reason for conveyancing is to ensure that the buyer is purchasing a marketable title and knows the extent and restrictions of the deeds.</p></div></div></div></div></div><div class=\"advice-section\"><div class=\"advice-section__inner\"><accordion-group data-ng-class=\"{true:'active', false:''}[isOpen]\" data-is-open=\"accordionStates[0]\" class=\"advice__section\"><accordion-heading class=\"advice__section-heading\"><h3>Why do I need legal advice?</h3><i></i></accordion-heading><div class=\"grid\"><div class=\"grid__item two-thirds\"><p>While it is actually possible to do the conveyancing yourself as long as youre not taking out a loan on the property, it is a complicated and involved process that requires special legal training and experience. We would always recommend a certified conveyancer to take the hassle out of the process.</p></div><div class=\"grid__item one-third\"><p><button class=\"contact-button--solicitor\" data-ng-click=\"openDialog('solicitor')\"><span class=\"i\"></span>Speak to a <span class=\"contact-button__help-type\">Legal Advisor</span></button></p></div></div></accordion-group></div></div><div class=\"advice-section\"><div class=\"advice-section__inner\"><accordion-group data-ng-class=\"{true:'active', false:''}[isOpen]\" data-is-open=\"accordionStates[1]\" class=\"advice__section\"><accordion-heading class=\"advice__section-heading\"><h3>Who does the conveyancing?</h3><i></i></accordion-heading><div class=\"advice__comparison-panels compare-three\"><div class=\"advice__comp-panel comp-panel\"><h4 class=\"comp-panel-heading comp-panel-heading--blue\">You</h4><div class=\"comp-panel-body\"><p>Unless you are yourself a solicitor, its almost always not worth your time. The conveyancing process is one of the more antiquated in English law and hold ups could cost you your dream property.</p></div></div><div class=\"advice__comp-panel-vs-div advice__comp-panel-vs-div--blue-green\"></div><div class=\"advice__comp-panel comp-panel\"><h4 class=\"comp-panel-heading comp-panel-heading--green\">Licenced Conveyancer</h4><div class=\"comp-panel-body\"><p>Licensed conveyancers are specialists in the field and usually have more time to deal with property issues. While they can perform conveyancing-related tasks, they can only guide and assist with other property-specific legal issues. They are regulated by the Council of Licensed Conveyancers.</p></div></div><div class=\"advice__comp-panel-vs-div advice__comp-panel-vs-div--green-red\"></div><div class=\"advice__comp-panel comp-panel\"><h4 class=\"comp-panel-heading comp-panel-heading--red\">Solicitor</h4><div class=\"comp-panel-body\"><p>A fully trained solicitor will have knowledge and advice to give you regarding your whole homebuying journey. However, you may find that they have less time to deal with conveyancing issues, as they work in a variety of fields. Solicitors are regulated by the Solicitors Regulation Authority.</p></div></div></div></accordion-group></div></div><div class=\"advice-section\"><div class=\"advice-section__inner\"><accordion-group data-ng-class=\"{true:'active', false:''}[isOpen]\" data-is-open=\"accordionStates[2]\" class=\"advice__section advice__section-process\"><div class=\"advice__process-inner-padding\"><accordion-heading class=\"advice__section-heading\"><h3>Timing and process</h3><i></i></accordion-heading><p>On average the property buying process takes around 8 to 12 weeks from the time you hire a conveyancer. However, this can be decreased if you pay cash or everyone involved is outside of a chain. Ultimately, the conveyancing process can only move as fast as it is allowed by other issues. Mortgage applications and arrangements can add a significant amount of time to the process, as can other, less organised, buyers or conveyancers.</p><div class=\"advice__process\"><p class=\"advice__process-start\"><span>Offer Accepted</span></p><ol><li class=\"item item1\"><span class=\"number\">1</span><div class=\"content content--align-top\"><span>Instruct your conveyancer</span><div class=\"content-popup\"><ul><li>Make sure you choose a top conveyancer</li><li>Get a quote</li><li>Having a conveyancer ready early puts you in a much stronger bargaining position</li></ul></div></div></li><li class=\"item item2\"><span class=\"number\">2</span><div class=\"content content--align-top\"><span>Receive notification of sale</span><div class=\"content-popup\"><ul><li>Sometimes called a memorandum of sale or sales particulars</li><li>Sets out the terms of the sale and has everyones particulars setting out any special conditions, such as a complete-by date</li><li>Your solicitor will request local property search packages at this stage</li></ul></div></div></li><li class=\"item item3\"><span class=\"number\">3</span><div class=\"content content--align-top\"><span>Solicitor receives draft contract &amp; title deeds</span><div class=\"content-popup\"><ul><li>Contains all the essential details of the contract and sales details</li><li>Your solicitor checks the documents and negotiates it with the sellers solicitor</li></ul></div></div></li><li class=\"item item4\"><span class=\"number\">4</span><div class=\"content content--align-top\"><span>Raise enquiries</span><div class=\"content-popup\"><ul><li>Once your solicitor has received the contract, they will return a list of enquiries</li><li>The vendors solicitor will provide replies to the enquiries</li></ul></div></div></li><li class=\"item item5\"><span class=\"number\">5</span><div class=\"content\"><span>Receive contract &amp; full report from solicitor</span><div class=\"content-popup\"><ul><li>Full report on contract, enquiries, searches and mortgage offer</li><li>Contains professional analysis and review of the details of the property, as well as pointing out any potential issues</li></ul></div></div></li><li class=\"item item6\"><span class=\"number\">6</span><div class=\"content\"><span>Check fittings &amp; fixtures</span><div class=\"content-popup\"><p>Summary of fixtures and fittings outlining what is included and excluded in the purchase</p></div></div></li><li class=\"item item7\"><span class=\"number\">7</span><div class=\"content\"><span>Mortgage offer received by solicitor</span><div class=\"content-popup\"><ul><li>Your lender has finished their checks and underwritten the mortgage, they will issue you and your solicitor with a full mortgage offer</li></ul></div></div></li><li class=\"item item8\"><span class=\"number\">8</span><div class=\"content\"><span>Sign the mortgage offer document</span> </div></li><li class=\"item item9 item--line-overlay\"><span class=\"number\">9</span><div class=\"content\"><span>Sign the contract</span><div class=\"content-popup\"><ul><li>Read, sign and return the contract to your solicitor</li><li>You should receive an identical copy signed by the seller</li></ul></div></div></li><li class=\"item item10\"><span class=\"number\">10</span><div class=\"content\"><span>Transfer deposit for exchange</span><div class=\"content-popup\"><ul><li>Typically a 10% deposit when you exchange contracts</li><li>Amount must be cleared in your solicitors client account before the exchange can happen</li></ul></div></div></li><li class=\"item item11\"><span class=\"number\">11</span><div class=\"content\"><span>Agree completion date</span><div class=\"content-popup\"><ul><li>Set a completion date (date from which the house will be vacated) before exchanging contracts</li><li>If you or the seller has a chain, you may need to arrange a date that fits in with that chain</li></ul></div></div></li><li class=\"item item12\"><span class=\"number\">12</span><div class=\"content\"><span>Exchange contracts</span><div class=\"content-popup\"><ul><li>Once you have finalised the mortgage and paid the deposit, you and your solicitor are ready to exchange contracts</li><li>After exchange of contracts, legally binding agreement</li></ul></div></div></li><li class=\"item item13\"><span class=\"number\">13</span><div class=\"content\"><span>Solicitor requests mortgage funds</span><div class=\"content-popup\"><ul><li>Solicitors job to ensure that all monies are ready on the day of completion</li><li>Mortgage provider will be informed when to transfer the mortgage amount</li></ul></div></div></li><li class=\"item item14 item--line-overlay\"><span class=\"number\">14</span><div class=\"content\"><span>Transfer residual funds</span><div class=\"content-popup\"><ul><li>Solicitor will confirm the residual amount to be transferred</li><li>Needs to have cleared funds in his client account to be able to complete</li></ul></div></div></li><li class=\"item item15\"><span class=\"number\">15</span><div class=\"content\"><span>Final check by solicitor</span><div class=\"content-popup\"><p>Solicitor reviews entire case before preparing for completion</p></div></div></li><li class=\"item item16\"><span class=\"number\">16</span><div class=\"content\"><span>Complete purchase</span><div class=\"content-popup\"><ul><li>Solicitor will release the funds to the sellers solicitor</li><li>Land Registry fees and stamp duty payable now</li><li>Receive the deeds to the property</li><li>Solicitor will notify the mortgage lender, freeholder (if appropriate) and insurance companies of the completed sale.</li><li>Solicitor will send statement of completion and the invoice</li></ul></div></div></li></ol><span class=\"line line--hori line--1\"></span><span class=\"line line--vert line--2\"></span><span class=\"line line--hori line--3\"></span><span class=\"line line--vert line--4\"></span><span class=\"line line--hori line--5\"></span><span class=\"line line--vert line--6\"></span><span class=\"line line--hori line--7\"></span><p class=\"advice__process-finish\"><span>Ready to move in</span></p></div></div></accordion-group></div></div><div class=\"advice-section\"><div class=\"advice-section__inner\"><accordion-group data-ng-class=\"{true:'active', false:''}[isOpen]\" data-is-open=\"accordionStates[3]\" class=\"advice__fees advice__section\"><accordion-heading class=\"advice__section-heading\"><h3>Four key steps in the process</h3><i></i></accordion-heading><p>While every step of the buying process is vital, there are four key areas that you need to know about and understand, because they involve you.</p><div data-pl-tabset=\"buyingProcessTabset\" data-pl-css-block-modifier=\"main\"><div data-pl-tab=\"\" data-pl-tab-title=\"Contract\"><p>A contract is a legally binding document between you and the vendor. Once the offer has been accepted, the sellers solicitor creates a contract to be sent to your solicitor. Your solicitor will then review the contract and submit additional information about the property to you in the form of a contract pack. Once youve reviewed the contents of the pack and queried anything youre not sure about with your solicitor, you can sign it to complete the agreement process.</p></div><div data-pl-tab=\"\" data-pl-tab-title=\"Mortgage Offer\"><p>While the contract process is happening, you can get on with the business of arranging a mortgage with your selected lender. After a property valuation, your lender will draft a mortgage offer, which you will need to send to your solicitor. As well as the obligatory mortgage valuation of the property, its a good idea to have one of a number of different types of survey competed on the property. While not compulsory, these will save you grief in the long run, as more comprehensive surveys can reveal issues that may reduce the value of your home or increase the cost of maintenance and repairs.</p></div><div data-pl-tab=\"\" data-pl-tab-title=\"Exchange of Contracts\"><p>In exchanging contracts you are entering into a legal agreement that binds both parties to the sale. It can be both exciting and nerve-racking. Before this happens, both the buyers and sellers solicitors gather together all of the remaining paperwork to make sure there are no gaps in the documentation. It is standard for you to pay 10% (this is usually negotiable) of the purchase price as a deposit on exchange of contracts. Once thats all sorted, youre free to continue with your homebuying journey. This might include things such as notifying utilities providers, and arranging completion and moving-in dates.</p></div><div data-pl-tab=\"\" data-pl-tab-title=\"Completion\"><p>Completion is when the property becomes legally yours. After this landmark date, all you have to deal with is the moving process and finding a nice bottle of bubbly to celebrate with.</p></div></div></accordion-group></div></div><div class=\"advice-section\"><div class=\"advice-section__inner\"><accordion-group data-ng-class=\"{true:'active', false:''}[isOpen]\" data-is-open=\"accordionStates[4]\" class=\"advice__fees advice__section\"><accordion-heading class=\"advice__section-heading\"><h3>The fees</h3><i></i></accordion-heading><p>Obviously, its important for you to make sure you understand all the fees involved in hiring a conveyancer. Weve listed them here, so you know what youll have to pay for and when.</p><div class=\"grid advice__fees__content\"><div class=\"grid__item two-fifths advice__fees-left\"><div class=\"advice__fees-content-row advice__fees-content-row--pound\"><i class=\"i sprite-icon-blue-pound\"></i><h4>Initial Payment</h4><p>The initial payment usually covers both the admin associated with opening dealings with your conveyancer, as well as survey fees.</p></div><div class=\"advice__fees-content-row advice__fees-content-row--percent\"><i class=\"i sprite-icon-percent\"></i><h4>Conveyancing fee</h4><p>The actual fee for conveyancing usually depends on the price of the property and the complexity of the purchase. Be sure to check out our <a href=\"/calculators/affordability/\">Fee Calculator</a> to get a clearer idea of exactly how much yours will be.</p></div></div><div class=\"grid__item three-fifths advice__fees-right\"><div data-pl-tabset=\"feesTabset\" data-pl-css-block-modifier=\"vertical\"><div data-pl-tab=\"\" data-pl-tab-title=\"Title Indemnity Insurance\"><p>This is a type of insurance your lender may require that is related to problems with the property, such as building regulation issues or land disputes. This protects you against legal action arising from these issues.</p></div><div data-pl-tab=\"\" data-pl-tab-title=\"Bank transfer fee\"><p>Due to the large sums of money involved in buying a property, and the costs associated with moving that money around, banks will often charge buyers fees for transferring monies in one go. On occasion, buyers may have some funds due to be returned and this is usually done by cheque. Buyers can have the money deposited directly into an account. In each transfer you may incur a fee of around &pound;30 plus VAT.</p></div><div data-pl-tab=\"\" data-pl-tab-title=\"Search packages\"><p>Search packages dig up all the information about the history and condition of the property as is possible. A search package can include a local authority search, a water authority search, a drainage search and a bankruptcy search. This is so the lender can be sure that youre buying proper, marketable deeds to the property and there is no problem that would prevent you from taking a mortgage out on it. The cost for this comes in at &pound;270 including VAT.</p></div><div data-pl-tab=\"\" data-pl-tab-title=\"Stamp duty\"><p>This is a tax based on a percentage of your propertys value to be paid directly to the government.</p></div><div data-pl-tab=\"\" data-pl-tab-title=\"ID checks\"><p>You may have to pay for ID checks if you are involved in a property transaction.</p></div><div data-pl-tab=\"\" data-pl-tab-title=\"Land registry fee\"><p>Land Registary fees are to pay for the accurate record keeping that allows you to conduct searches. The costs change as a function of to the value of your property. You can find the exact fees for your specific property here.</p></div><div data-pl-tab=\"\" data-pl-tab-title=\"Acting for mortgage lender\"><p>This fee is the cost of drafting the contract for the mortgage agreement, which outlines the terms of your loan. Your solicitor will be able to clear up any queries you may have about this document.</p></div></div></div></div></accordion-group></div></div><div class=\"advice-section\"><div class=\"advice-section__inner\"><accordion-group data-ng-class=\"{true:'active', false:''}[isOpen]\" data-is-open=\"accordionStates[5]\" class=\"advice__pledges advice__section\"><accordion-heading class=\"advice__section-heading\"><h3>Conveyancing association pledges</h3><i></i></accordion-heading><p>As a member of the Conveyancing Association (CA)*, our partners are proud to support and uphold the CA Pledges which are designed to make the process of buying a house smoother and more efficient for our clients and partners elsewhere in the transaction.</p><p>The Pledges, which were launched in December 2012, are the conveyancing industrys first ever set of customer service commitments that go above and beyond existing regulations and accreditation schemes. e that home-buyers should expect when making one of the biggest decisions of their lives.</p><ol class=\"advice__pledge-list grid\"><li class=\"pledge-item grid__item one-sixth\"><span class=\"number\">1</span><h4>Quality of service</h4><p>Members will provide a first rate conveyancing service to all clients, regardless of the value of the instructions</p></li><li class=\"pledge-item grid__item one-sixth\"><span class=\"number\">2</span><h4>Client Satisfaction</h4><p>Members will ensure that its clients are satisfied with their service by requesting and acting on client feedback</p></li><li class=\"pledge-item grid__item one-sixth\"><span class=\"number\">3</span><h4>Efficient process</h4><p>Members will work to cut out delays in the conveyancing process and take steps to ensure that transactions run as smoothly as possible</p></li><li class=\"pledge-item grid__item one-sixth\"><span class=\"number\">4</span><h4>Title &amp; Registration</h4><p>Members will ensure that property is acquired with a good and marketable title and promptly registered at the Land Registry</p></li><li class=\"pledge-item grid__item one-sixth\"><span class=\"number\">5</span><h4>Combating fraud</h4><p>Members will take pro-active steps to protect mortgage funds and combat mortgage and property fraud</p></li><li class=\"pledge-item grid__item one-sixth\"><span class=\"number\">6</span><h4>Mutual support &amp; trusted community</h4><p>Members will work towards a trusted community of conveyancers through mutual support and information sharing between members</p></li></ol><p>*<a href=\"http://www.theconveyancingassociation.co.uk/pdfs/Conveyancing%20Association%20Pledges.pdf\" target=\"_blank\">The Conveyancing Association</a></p></accordion-group></div></div><div class=\"advice-section\"><div class=\"advice-section__inner\"><accordion-group data-ng-class=\"{true:'active', false:''}[isOpen]\" data-is-open=\"accordionStates[6]\" class=\"advice__pledges advice__section\"><accordion-heading class=\"advice__section-heading\"><h3>The UK's best property lawyers - working with you every step of the way!</h3><i></i></accordion-heading><div class=\"grid\"><div class=\"grid__item two-thirds\"><ul><li>Accredited member of the Law Societys Conveyancing Quality Scheme</li><li>Pledge to the Conveyancing Association (CA), designed to make the process of buying a house smoother and more efficient</li><li>Homebuyers Plus with every transaction</li><li>Transparency &amp; Certainty</li><li>Free online Will writing</li><li>10% discount for First Time Buyers</li><li>No hidden costs</li><li>No success, no fee promise</li><li>Free first advice, no obligation and complete confidence</li></ul></div><div class=\"grid__item one-third\"><div class=\"yellow-box\"><h4>Get a conveyancing quote</h4><form class=\"form\" data-ng-controller=\"ConveyancingFormController\"><div data-ng-hide=\"conveyancing.type=='selling'\"><div class=\"form__row grid\"><label class=\"form__label grid__item one-half\">Purchase price:</label><div class=\"input input--prepend inline-fieldset__field grid__item one-half\"><span class=\"input__add-on\"></span><input type=\"text\" class=\"form__input input__field\" data-pl-number=\"\" data-pl-default-value-hider=\"0\" step=\"any\" min=\"0\" placeholder=\"0\" data-ng-model=\"conveyancing.purchasePrice\" data-ng-change=\"onPurchasePriceChanged()\"></div></div><div class=\"form__row\"><span class=\"radio-input\"><label class=\"radio-input__label\"><input name=\"buying-property-type\" type=\"radio\" class=\"radio-input__field\" value=\"freehold\" data-ng-model=\"conveyancing.buyingPropertyType\">Freehold<span class=\"radio-input__background\"></span><span class=\"radio-input__active-icon\"></span></label></span><span class=\"radio-input\"><label class=\"radio-input__label\"><input name=\"buying-property-type\" type=\"radio\" class=\"radio-input__field\" value=\"leasehold\" data-ng-model=\"conveyancing.buyingPropertyType\">Leasehold<span class=\"radio-input__background\"></span><span class=\"radio-input__active-icon\"></span></label></span></div></div><div class=\"form__section\"><div class=\"form__row grid\"><label class=\"form__label grid__item two-thirds\">Legal fees ex VAT:</label><span class=\"form__fixed-value form__align-right\"><strong data=\"\" ng-hide=\"conveyancing.legalFeesOnRequest\" data-ng-bind=\"conveyancing.fees.legalFees | noFractionCurrency:''\"></strong><strong data=\"\" ng-show=\"conveyancing.legalFeesOnRequest\">On request</strong></span></div><div class=\"form__row\" data-ng-hide=\"conveyancing.type=='selling'\"><span class=\"checkbox-input\"><label class=\"checkbox-input__label\"><input type=\"checkbox\" class=\"checkbox-input__field\" data-ng-model=\"conveyancing.isFirstTimeBuyer\" data-ng-change=\"onPurchasePriceChanged()\">Are you a first time buyer?<span class=\"checkbox-input__background\"></span><span class=\"checkbox-input__active-icon\"></span></label></span></div><div class=\"form__row\"><button type=\"button\" class=\"btn--link\" data-ng-click=\"openDialog('conveyancingQuote')\">See full quote</button></div></div></form></div></div></div></accordion-group></div></div></accordion><div class=\"advice-section advice-section--complete\"><div class=\"advice-section__inner\"><div class=\"line line--hori\"></div><button class=\"contact-button contact-button--solicitor--grey\" data-ng-click=\"openDialog('solicitor')\"><span class=\"i\"></span>Speak to a Legal Advisor</button></div></div></div>");
    $templateCache.put("/partials/views/milestone-tracking/milestone-tracking.html", "<div class=\"page-content page-content--milestone-tracking\"><div class=\"milestone-tracking__overview-wrapper\" data-ng-show=\"overviewReady\" id=\"milestoneOverview\"><a href=\"/milestone-tracking/\" class=\"milestone-tracking__overview-btn\"><i></i>Overview</a><div class=\"milestone-tracking__overview\" data-ng-class=\"{'active': !currentMilestone}\"><ul class=\"milestone-tracking__overview-groups\"><li data-ng-repeat=\"group in milestoneGroups\" class=\"[[group]]\" data-ng-style=\"{width: groupWidthPercentage(group) + '%'}\"><span class=\"milestone-tracking__overview-group-heading\"><span><i></i>[[group]]</span></span></li></ul><ul class=\"milestone-tracking__milestones\"><li data-ng-repeat=\"milestone in milestones\" class=\"[[milestone.group]] completed-[[isMilestoneCompleted(milestone)]] active-[[currentMilestone == milestone.number]]\"><span class=\"milestone-tracking__overview-number\"><span>[[milestone.number]]</span></span><div class=\"milestone-tracking__overview-content\"><div class=\"milestone-tracking__overview-heading\"><a class=\"milestone-tracking__overview-title\" href=\"?milestonetracking.milestone=[[milestone.number]]\">[[milestone.title]]</a><ul class=\"milestone-tracking__overview-indicators [[milestone.group]]\"><li data-ng-repeat=\"item in milestone.items\" class=\"completed-[[item.completed]]\"></li></ul></div><ul class=\"milestone-tracking__overview-items [[milestone.group]]\"><li data-ng-repeat=\"item in milestone.items\" class=\"completed-[[item.completed]]\"><a href=\"?milestonetracking.milestone=[[milestone.number]]&amp;milestonetracking.item=[[item.number]]\"><span class=\"milestone-tracking__item-number\">[[milestone.number]].[[item.number]]</span>&nbsp;<span class=\"milestone-tracking__item-title\">[[item.title]]</span></a></li></ul></div></li></ul></div><div class=\"milestone-tracking__detail [[milestone.group]] milestone-[[milestone.number]]\" data-ng-repeat=\"milestone in milestones\" data-ng-show=\"currentMilestone == milestone.number\"><div class=\"milestone-tracking__detail-wrapper [[milestone.group]]\"><div class=\"milestone-tracking__detail-milestone-header\"><button data-ng-class=\"{'milestone-tracking__detail-expand': !allItemsExpanded, 'milestone-tracking__detail-collapse': allItemsExpanded}\" data-ng-click=\"allItemsExpanded = !allItemsExpanded\"><span data-ng-show=\"!allItemsExpanded\">Expand all</span><span data-ng-show=\"allItemsExpanded\">Collapse all</span><i></i></button><h2 class=\"milestone-tracking__detail-milestone-heading\">[[milestone.number]]. [[milestone.title]]</h2></div><accordion class=\"milestone-tracking__detail-items\" data-close-others=\"false\" id=\"milestone-[[milestone.number]]\"><accordion-group id=\"item-[[milestone.number]]-[[item.number]]\" data-ng-repeat=\"item in milestone.items\" is-open=\"item.number == currentItem || allItemsExpanded\" data-ng-class=\"{'active': isOpen}\" class=\"milestone-tracking__detail-item\"><accordion-heading class=\"milestone-tracking__detail-item-header\"><h3 class=\"milestone-tracking__detail-item-heading completed-[[item.completed]]\">[[milestone.number]].[[item.number]] [[item.title]] <i></i></h3></accordion-heading><div class=\"milestone-tracking__detail-checkbox\"><span class=\"checkbox-input\"><label class=\"checkbox-input__label\"><input type=\"checkbox\" class=\"checkbox-input__field\" data-ng-model=\"item.completed\" data-ng-change=\"itemChanged(milestone.number, item)\"><span data-ng-hide=\"item.completed\">Step completed?</span><span data-ng-show=\"item.completed\">Thanks, well done!</span><span class=\"checkbox-input__background--blue\"></span><span class=\"checkbox-input__active-icon--blue\"></span></label></span></div><div class=\"milestone-tracking__detail-content\"><div class=\"milestone-tracking__detail-text\" data-pl-bind-html-unsafe-compile=\"item.text\" id=\"milestone-[[milestone.number]]-[[item.number]]\"></div><div class=\"milestone-tracking__detail-tips\"><h4>Useful tips</h4><ul><li data-ng-repeat=\"tip in item.tips\" data-pl-bind-html-unsafe-compile=\"tip\"></li></ul></div></div></accordion-group></accordion></div><div class=\"milestone-tracking__detail-nav\"><a class=\"milestone-tracking__detail-nav-next\" href=\"?milestonetracking.milestone=[[milestones[$index+1].number]]\" data-ng-show=\"milestones[$index+1]\">[[milestones[$index+1].title]] <i></i></a><a class=\"milestone-tracking__detail-nav-prev\" href=\"?milestonetracking.milestone=[[milestones[$index-1].number]]\" data-ng-show=\"milestones[$index-1]\"><i></i> [[milestones[$index-1].title]]</a></div></div></div><div class=\"milestone-tracking__spinner\" data-pl-spinner=\"showSpinner\" data-pl-spinner-config=\"DEFAULT\"></div></div>");
    $templateCache.put("/partials/views/milestone-tracking/tooltips/agreement-in-principle.html", "<p>A provisional lending decision offered by a specific mortgage lender. The lender will confirm how much it might be prepared to lend even before you find a property. An agreement in principle is not legally binding, so dont rely on this until you have a full credit offer.</p>");
    $templateCache.put("/partials/views/milestone-tracking/tooltips/block-insurance-policies.html", "<p>This is essential cover for landlords to protect their buildings against damage against a range of unexpected incidents, including fire, storms, flooding, escape of water, subsidence, theft and property owners liability.</p>");
    $templateCache.put("/partials/views/milestone-tracking/tooltips/budget.html", "<p>A finance plan that allocates personal income towards expenses, savings and debt repayment. Past spending and personal debt are considered when creating a personal budget.</p>");
    $templateCache.put("/partials/views/milestone-tracking/tooltips/building-regulations.html", "<p>Most new buildings, alterations, extensions and changes of the use of existing buildings are subject to building regulations. These are approved by Parliament and apply throughout England and Wales.</p><p>They define 'building work' and explain the procedures to ensure that work meets the required standards.</p>");
    $templateCache.put("/partials/views/milestone-tracking/tooltips/building-surveys.html", "<p>Sometimes referred to as a structural survey, this is an in-depth structural analysis of the inside and outside of a property that should reveal any hidden faults. This is carried out by a chartered surveyor who writes an extensive report outlining any defects. Structural surveys tend to be carried out on older properties, those that have been poorly maintained or where there are subsidence concerns.</p>");
    $templateCache.put("/partials/views/milestone-tracking/tooltips/buyers-market.html", "<p>The buyer has the advantage, as there are more people needing to sell than looking to buy. Since homes can stay on the market for months, sellers may be more willing to consider below-asking-price offers and make concessions like helping you pay closing costs, or fixing both major and minor repairs.</p>");
    $templateCache.put("/partials/views/milestone-tracking/tooltips/certified-id.html", "<p>Confirmation of identification comes in two parts  your name and your address. The most common way to confirm your name is your passport and for your address its usual to provide a utility bill showing your name and address. Both these documents must be originals.</p>");
    $templateCache.put("/partials/views/milestone-tracking/tooltips/chain.html", "<p>The often protracted situation whereby a buyer is waiting on the completion of the sale of an existing property in order to complete on the purchase of a new property.</p>");
    $templateCache.put("/partials/views/milestone-tracking/tooltips/complete-by-date.html", "<p>The day when ownership of the property is passed to you and all conditions of the mortgage come into effect. The balance of the purchase price is paid and the seller hands over the deeds. The seller must move out on this date and you can move in. Your completion date is agreed when contracts are exchanged.</p>");
    $templateCache.put("/partials/views/milestone-tracking/tooltips/completion.html", "<p>The completion date is the date that your solicitor forwards the money from your lender to the sellers solicitor. In short, its the date that you become the legal owner of your new property.</p>");
    $templateCache.put("/partials/views/milestone-tracking/tooltips/contents-insurance.html", "<p>Covers your household possessions against loss, damage or theft. Items covered by a typical contents policy include electrical goods, furniture, carpets, clothes, ornaments and paintings.</p>");
    $templateCache.put("/partials/views/milestone-tracking/tooltips/conveyancer.html", "<p>A specialist lawyer who specialises in the legal aspects of buying and selling real property, or conveyancing. A conveyancer can also be a solicitor, a licensed conveyancer or a fellow of the Institute of Legal Executives.</p>");
    $templateCache.put("/partials/views/milestone-tracking/tooltips/credit-rating.html", "<p>Normally based on a persons credit history. This is an assessment of whether or not they will be able to keep up repayments on a loan.</p>");
    $templateCache.put("/partials/views/milestone-tracking/tooltips/deeds.html", "<p>The legal documents that prove ownership of a property. Deeds are usually held by the lender.</p>");
    $templateCache.put("/partials/views/milestone-tracking/tooltips/direct-debit.html", "<p>An instruction from you to your bank or building society. This authorises the organisation you want to pay to collect varying amounts from your account, but only if youve been given advance notice of the amounts and dates of collection. Once you have agreed those, the money is deducted automatically.</p>");
    $templateCache.put("/partials/views/milestone-tracking/tooltips/disposable-income.html", "<p>The amount of money available for spending and saving after income taxes and other expenses have been accounted for. For example, if your income is 4,000 and you spend 2,200 on all your expenses, your disposable income is 1,800.</p>");
    $templateCache.put("/partials/views/milestone-tracking/tooltips/enquiries.html", "<p>A collection of detailed questions from either party regarding various aspects of the prospective property for purchase. The seller or their solicitor must answer these fully before any contracts may be signed.</p>");
    $templateCache.put("/partials/views/milestone-tracking/tooltips/equity.html", "<p>The amount of value in a property that isnt covered by a mortgage. To work it out, simply subtract the amount of the mortgage from the valuation of the property. For example, if your house value is 500,000 and your current mortgage is 350,000, your equity would be 150,000.</p>");
    $templateCache.put("/partials/views/milestone-tracking/tooltips/exchange-of-contracts.html", "<p>The point at which the buyer signs the contract for sale and sends it to the seller who also signs it. Both buyer and seller are then legally bound to complete the transfer. Once the contract has been signed, the contract becomes legally binding, meaning that if the buyer or seller pulls out prior to completion, they may have to pay compensation.</p>");
    $templateCache.put("/partials/views/milestone-tracking/tooltips/fixed-rate.html", "<p>The interest rate set at an agreed rate for an agreed period, often two or five years. It is especially favoured by people who want to know exactly what they are paying each month as it is not vulnerable to changes in the base rate.</p>");
    $templateCache.put("/partials/views/milestone-tracking/tooltips/fixtures-and-fittings.html", "<p>There is no legal definition of what constitutes fixtures and what constitutes fittings. However, it is generally considered that fixtures are items that are secured or bolted to the walls or floor and fittings are free-standing items.</p>");
    $templateCache.put("/partials/views/milestone-tracking/tooltips/freehold.html", "<p>If you own your propertys freehold, you not only own the property itself but also the land that it is on.</p>");
    $templateCache.put("/partials/views/milestone-tracking/tooltips/gazumping.html", "<p>This is when the person selling a property accepts an initial offer and then accepts a second, higher, offer from a different buyer prior to the exchange of contracts. This tends to happen in strong housing markets.</p>");
    $templateCache.put("/partials/views/milestone-tracking/tooltips/gross-income.html", "<p>An individual's total personal income before taking taxes or deductions into account.</p>");
    $templateCache.put("/partials/views/milestone-tracking/tooltips/higher-lending-charges.html", "<p>A charge made by mortgage lenders when the loan-to-value ratio of a mortgage is higher than they are prepared to accept at standard rates. Typically applied to loans in excess of 90% of the property value.</p>");
    $templateCache.put("/partials/views/milestone-tracking/tooltips/home-buyers-report.html", "<p>A property survey or report. This is halfway between a mortgage valuation and a full survey, and is intended to satisfy the buyer that the property they are purchasing is in good condition.</p>");
    $templateCache.put("/partials/views/milestone-tracking/tooltips/home-insurance.html", "<p>Home insurance can be split into two cover types  buildings insurance and contents insurance. Buildings insurance covers any damage to the structure of the building itself. Contents insurance covers damage to, or loss of, any personal possessions in the property. These can be bought separately, although most insurance providers also bundle both together.</p>");
    $templateCache.put("/partials/views/milestone-tracking/tooltips/indemnity-fees.html", "<p>An insurance policy designed to protect the lender against loss in the event of you defaulting and ceasing to repay your mortgage. The policy may be insisted on by the lender at the start of the loan, but it\"s usually the borrower who pays the premium.</p>");
    $templateCache.put("/partials/views/milestone-tracking/tooltips/independent-mortgage-advisor.html", "<p>To be able to call themselves independent, advisers must be able to offer advice on the full range of mortgage products and providers, make a fair and comprehensive analysis and recommend a suitable one for you in the light of your circumstances. They must also be free from any influence that could stop them recommending the best product for you.</p>");
    $templateCache.put("/partials/views/milestone-tracking/tooltips/insurance-premiums.html", "<p>The amount of money charged by a company for active insurance coverage. The sum a person pays in premiums, also referred to as the rate, is determined by several factors, including age, health and the area a person lives in.</p>");
    $templateCache.put("/partials/views/milestone-tracking/tooltips/interest-rate.html", "<p>Interest is what lenders charge people for borrowing money. Exactly how much interest is charged depends upon many factors, including the loans duration and the deemed credit risk.</p>");
    $templateCache.put("/partials/views/milestone-tracking/tooltips/interest-rates.html", "<p>The amount charged, expressed as a percentage of the principal, by a lender to a borrower for the use of assets. Interest rates are typically noted on an annual basis, known as the annual percentage rate (APR).</p>");
    $templateCache.put("/partials/views/milestone-tracking/tooltips/key-facts-illustration.html", "<p>Explains the key features of your mortgage and tells you what your initial monthly payments would be, based on the information you provided during your quote.</p>");
    $templateCache.put("/partials/views/milestone-tracking/tooltips/land-registry-fees.html", "<p>The fee paid to the Land Registry to register the ownership of a specific area of land.</p>");
    $templateCache.put("/partials/views/milestone-tracking/tooltips/land-registry.html", "<p>An executive agency of the Government of the United Kingdom that registers the ownership of land and property in England and Wales. It is one of the largest property databases in Europe.</p>");
    $templateCache.put("/partials/views/milestone-tracking/tooltips/lender.html", "<p>Any institution or individual who loans a borrower money. There are a number of types of lending organisations, including educational, commercial, lenders of last resort and mutual organisations. The most traditional type is a commercial lender, which is often a banking institution, though it may also be a private financial group.</p>");
    $templateCache.put("/partials/views/milestone-tracking/tooltips/life-cover.html", "<p>Life assurance policies pay out either a lump sum or a series of payments when a person dies during the term of a policy, usually to his or her dependants. In most instances, these payments  known as the sum assured  are tax-free.</p>");
    $templateCache.put("/partials/views/milestone-tracking/tooltips/ltv.html", "<p>A mortgage term describing the amount of money a bank or building society will lend you as a percentage of your propertys value. 95% is a common LTV although in some cases they will lend the full value of the property, or 100% LTV.</p>");
    $templateCache.put("/partials/views/milestone-tracking/tooltips/mortgage-deed.html", "<p>This is a deed that formally secures money against the property. It is drawn up by your mortgage lender to be signed before completion. Your conveyancer sends it to the Land Registry after completion.</p>");
    $templateCache.put("/partials/views/milestone-tracking/tooltips/mortgage-offer.html", "<p>A written offer to lend money on a property. The mortgage offer will contain all the terms of the loan and the conditions upon which the money is lent to the borrower.</p>");
    $templateCache.put("/partials/views/milestone-tracking/tooltips/mortgages.html", "<p>A loan where the mortgaged property acts as security for the lender until the loan is repaid in full  often after 25 years.</p>");
    $templateCache.put("/partials/views/milestone-tracking/tooltips/net-worth.html", "<p>Refers to an individual's net economic position. It is calculated using the value of all assets (long term assets) minus the value of all liabilities. For example, if you have assets of 350,000 and liabilities of 150,000, your net worth is 200,000.</p>");
    $templateCache.put("/partials/views/milestone-tracking/tooltips/neutral-market.html", "<p>Neither the buyer nor seller has an advantage, as the number of buyers looking for homes balances the number of homes for sale. Buyer and seller are on equal footing in negotiations, and most homes sell within a couple of days.</p>");
    $templateCache.put("/partials/views/milestone-tracking/tooltips/non-refundable-admin-charge.html", "<p>A charge levied by the lender to cover the costs of processing your mortgage application. If you do not complete your application, the fee may not be refunded. The administration fee is also sometimes known as an application fee.</p>");
    $templateCache.put("/partials/views/milestone-tracking/tooltips/notification-of-sale.html", "<p>This is another name for the Memorandum of Sale. It is a non-legally binding letter setting out the terms of the sale, including the details of the legal firms acting for each party.</p>");
    $templateCache.put("/partials/views/milestone-tracking/tooltips/off-the-market.html", "<p>This typically means that the property is not available anymore and the seller has told their estate agents not to show it to other potential buyers.</p>");
    $templateCache.put("/partials/views/milestone-tracking/tooltips/p60.html", "<p>A statement issued to taxpayers at the end of a tax year. It is important a taxpayer does not destroy the P60 forms issued to them, as they form a vital part of the proof that tax has been paid.</p>");
    $templateCache.put("/partials/views/milestone-tracking/tooltips/planning-permission.html", "<p>Construction of new buildings and extensive changes to existing buildings usually requires consent from the local planning authority. This planning system is designed to control inappropriate development.</p>");
    $templateCache.put("/partials/views/milestone-tracking/tooltips/rainy-day-fund.html", "<p>A reserved amount of money to be used when your regular income is disrupted or decreased in order for typical expenses to continue. We recommended having at least 3 months of your net salary put aside as a rainy-day or emergency fund.</p>");
    $templateCache.put("/partials/views/milestone-tracking/tooltips/reinstatement-value.html", "<p>Refers not to the market value of the property, but what it would cost to rebuild using similar materials and methods of construction. This could apply to anything from sourcing a specific building stone or roof tiles, to recovering historic fireplaces.</p>");
    $templateCache.put("/partials/views/milestone-tracking/tooltips/repayments.html", "<p>Requires borrowers to repay on a monthly basis not just the interest on the loan but also a slice of the capital borrowed. This kind of mortgage is usually favoured by more conservative homeowners who want to guarantee that at the end of the mortgage term, the property will belong to them.</p>");
    $templateCache.put("/partials/views/milestone-tracking/tooltips/report-on-title.html", "<p>Provided by a solicitor, it comments on the extent to which the property title is good and marketable.</p>");
    $templateCache.put("/partials/views/milestone-tracking/tooltips/search.html", "<p>A search is comprised of the checks carried out during the conveyancing process before the offer of a loan. They are made with local authorities and other organisations and reveal any planning proposals that could adversely affect the value of a property in the future.</p>");
    $templateCache.put("/partials/views/milestone-tracking/tooltips/sellers-market.html", "<p>The seller has the advantage, as more buyers are homehunting than there are homes to buy. Prices often rise as more buyers compete for fewer homes, and many homes sell within a couple of days.</p>");
    $templateCache.put("/partials/views/milestone-tracking/tooltips/shared-freehold.html", "<p>This means you will own a portion of the freehold and the freehold will be divided equally between all owners. For example, if there are 4 freehold flats in a block, each flat will own 25% of the freehold.</p>");
    $templateCache.put("/partials/views/milestone-tracking/tooltips/stamp-duty.html", "<p>A tax levied on property purchases applied on a sliding scale according to the price of a property, as shown here:</p><p>Below 125,000  free from stamp duty</p><p>125,000 to 250,000  1%</p><p>250,000 to 500,000  3%</p><p>500,000 to 1m  4%</p><p>1m to 2m are charged at 5%.</p><p>2m or more  7% (15% if held in corporate accounts)</p>");
    $templateCache.put("/partials/views/milestone-tracking/tooltips/standard-variable-rate.html", "<p>A type of interest rate on a mortgage that often moves in line with the Bank of England base rate. However, unlike a tracker mortgage, changes are ultimately at the lenders discretion.</p>");
    $templateCache.put("/partials/views/milestone-tracking/tooltips/statement-of-completion.html", "<p>Sent by the seller's conveyancer to the buyer's conveyancer on the sale of freehold or leasehold properties. This document sets out exactly what amount is payable by the buyer on completion.</p>");
    $templateCache.put("/partials/views/milestone-tracking/tooltips/subject-to-contract.html", "<p>The term sold subject to contract has no legal standing but is a phrase used as a provisional agreement before contracts have been exchanged. At this point either party may still withdraw from the transaction. Often seen on estate agent boards.</p>");
    $templateCache.put("/partials/views/milestone-tracking/tooltips/survey.html", "<p>A health check on a property telling you its exact current structural state, which is usually performed when the property is about to be sold. Surveys can often save the buyer money if there are any major structural problems, as they can bring about a change in the sale price.</p>");
    $templateCache.put("/partials/views/milestone-tracking/tooltips/transactional-charges.html", "<p>Conveyancing costs are broadly split between the fees charged by the professional and are often associated with the transaction, such as searching the local authority database, and registering the property once the transfer has been undertaken.</p>");
    $templateCache.put("/partials/views/milestone-tracking/tooltips/under-offer.html", "<p>A property is said to be under offer when a seller has accepted an offer from a buyer but the exchange of contracts has not yet been reached.</p>");
    $templateCache.put("/partials/views/milestone-tracking/tooltips/underwriting.html", "<p>The process a lender uses to determine if the risk (especially the risk that the borrower will default) of offering a mortgage loan to a particular borrower is acceptable. Most of the risks and terms that underwriters consider fall under the three Cs of underwriting: capacity, collateral and character.</p>");
    $templateCache.put("/partials/views/milestone-tracking/tooltips/valuation-fee.html", "<p>A fee charged by your mortgage lender for commissioning a mortgage valuation. A mortgage valuation is a basic inspection of your property, and its purpose is limited to establishing whether your home is suitable security to lend on.</p>");
    $templateCache.put("/partials/views/milestone-tracking/tooltips/variable-rate-mortgage.html", "<p>On a variable rate mortgage the interest rate charged by the lender goes up and down according to base rate movements, and your mortgage repayments change accordingly. The variable rate will always be slightly above the Bank of England base rate.</p>");
    $templateCache.put("/partials/views/mortgage-advice/mortgage-advice.html", "<div class=\"page-content page-content--mortgage-advice\"><div class=\"advice-section advice-section--intro\"><div class=\"advice-section__inner\"><h1>Mortgage Advice</h1><p>For most buyers, a mortgage is the largest debt load theyll take on. However, most homeowners dont fully understand how mortgages work and the process of getting one. Were here to help you make sense of the ins and outs of mortgages, so read on to get the full picture.</p></div></div><accordion class=\"advice__sections\" data-close-others=\"false\"><div class=\"advice-section\"><div class=\"advice-section__inner\"><div class=\"advice__section\"><div class=\"accordion-heading\"><h3>What is mortgage?</h3></div><div class=\"accordion-body\"><div class=\"accordion-inner\"><p>Buying a new property will usually require you to get a loan. This type of loan is called a mortgage. In essence, rather than being a simple loan to be paid back at high interest rates over a short space of time, a mortgage is a loan secured on your property. This means that should you default on your mortgage, your bank may repossess your home. The standard term for mortgages is 25 years, although this can vary depending on your circumstances.</p></div></div></div></div></div><div class=\"advice-section\"><div class=\"advice-section__inner\"><accordion-group data-ng-class=\"{true:'active', false:''}[isOpen]\" data-is-open=\"accordionStates[0]\" class=\"advice__section\"><accordion-heading class=\"advice__section-heading\"><h3>Timing and progress</h3><i></i></accordion-heading><p>The time it takes you to arrange a mortgage depends on many factors. The main ones are the complexity of the deal and how busy the lender is. If youre trying to work out timings, leave around 4-6 weeks to complete the whole deal. However, this is an average figure. Good mortgage advisors know which lender can process your application faster, and they can make product recommendations taking into account not only costs but also timing.</p><div class=\"advice__process\"><p class=\"advice__process-start\"><span>Start of Mortgage Process</span></p><ol><li class=\"item item1\"><span class=\"number\">1</span><div class=\"content content--align-top\"><span>Check your credit rating</span><div class=\"content-popup\"><ul><li>all lenders want to make sure they are lending money to someone who is likely to pay it back</li><li>Check your credit record \"online\" (link to Experian)</li><li>Simple things like paying all your credit cards on time and making sure you are on the voters roll at your current address will help</li><li>In general, the higher your credit score, the better your mortgage interest rates you can qualify for</li></ul></div></div></li><li class=\"item item2\"><span class=\"number\">2</span><div class=\"content content--align-top\"><span>Get mortgage advice</span><div class=\"content-popup\"><ul><li>Research the different ways of finding a mortgage lender yourself</li><li>Check online comparison websites</li><li>Get advice from an independent mortgage advicer - not only will they choose the best deal for you but they will also do the work for you!</li></ul></div></div></li><li class=\"item item3\"><span class=\"number\">3</span><div class=\"content content--align-top\"><span>Choose lender &amp; mortgage product</span><div class=\"content-popup\"><ul><li>Credit and affordability check by lender</li><li>Lender to confirm potential loan size</li></ul></div></div></li><li class=\"item item4\"><span class=\"number\">4</span><div class=\"content content--align-top\"><span>Get your documentation in order</span><div class=\"content-popup\"><ul><li>Lenders usually request detail of last three years address history (no gaps), last three months payslips and last P60 or three years accounts, your last three months bank statements and full details of any loans or credit cards you have</li><li>Providing this information on day one can speed up the process at the end</li></ul></div></div></li><li class=\"item item5\"><span class=\"number\">5</span><div class=\"content\"><span>Obtain a mortgage agreement in principle</span><div class=\"content-popup\"><ul><li>We suggest that you secure a mortgage agreement in principle before making an offer. This will ensure you know exactly what you can afford and also puts you in stronger position compare to competitors without an agreement in place</li><li>This will confirm in writing how much a lender will be prepared to lend you, subject to full mortgage application and underwriting</li><li>Confirms to vendor that you are creditworthy and a serious buyer</li></ul></div></div></li><li class=\"item item6\"><span class=\"number\">6</span><div class=\"content\"><span>Submit mortgage application</span><div class=\"content-popup\"><ul><li>Can be the most time consuming part and some lender's applications can be very detailed</li><li>Lenders will want full details of your employment or business, your existing loans or credit cards, bank account details and full details of the property</li><li>First stage that any money is actually spend, as some lenders will also take a non-refundable administration fee at this stage</li><li>Valuation fee is also typical at this stage</li></ul></div></div></li><li class=\"item item7\"><span class=\"number\">7</span><div class=\"content\"><span>Underwriting - Lender feedback on application</span><div class=\"content-popup\"><ul><li>Most frustrating part as the timing of this varies from lender to lender</li><li>First, lender will check all the documentation you have sent</li><li>Might require more information they want clarification on. If your application has been right however, this stage can be very quick</li></ul></div></div></li><li class=\"item item8\"><span class=\"number\">8</span><div class=\"content\"><span>Instruct valuation</span><div class=\"content-popup\"><ul><li>Second, lender will need to carry their own valuation on the property (which you have paid for)</li><li>This will show the overall condition and marketability of the property and then produce a valuation figure</li><li>Buyer can choose to upgrade to a Homebuyers or Structural survey which the same valuation officer can undertake</li></ul></div></div></li><li class=\"item item9 item--line-overlay\"><span class=\"number\">9</span><div class=\"content\"><span>Mortgage offer received</span><div class=\"content-popup\"><ul><li>Once underwriting has been successfully completed, finances checked and assuming the valuation figure is acceptable, the lender will produce a full Mortgage Offer</li><li>Will be sent to you and your solicitor which will detail the loan amount, the monthly repayments, details of the mortgage product and terms of the loan</li><li>Will also detail any special conditions that need to be met by you and/or your solicitor</li><li>Life cover should be considered and written in trust where appropriate to protect you and your family if you are not able to meet your mortgage payments due to unforeseen circumstances</li><li>Also need to arrange buildings and contents insurance to protect the property and your possessions ready for exchange</li></ul></div></div></li><li class=\"item item10\"><span class=\"number\">10</span><div class=\"content\"><span>Finalise mortgage - Solicitor</span><div class=\"content-popup\"><ul><li>Once the solicitor receives the full mortgage offer they will complete a \"Report on Title\"</li><li>This will include looking at Local Authority Reports, checking that the lease is all in order for leasehold properties and answering any specific questions the lender may have raised</li><li>Once complete this is then sent to the lender to review</li></ul></div></div></li><li class=\"item item11\"><span class=\"number\">11</span><div class=\"content\"><span>Exchange of contracts</span><div class=\"content-popup\"><ul><li>Once all parties, lender, solicitor and vendor, are happy an exchange and completion date is set</li><li>Exchange is the first date after which neither the buyer or seller can pull out of the transaction without large financial costs</li><li>A deposit of typically 10% of the purchase price is transferred to the vendors solicitor</li></ul></div></div></li><li class=\"item item12\"><span class=\"number\">12</span><div class=\"content\"><span>Complete purchase</span><div class=\"content-popup\"><ul><li>Your solicitor draws the remaining funds from you and your lender to complete on the purchase at the agreed date</li><li>Congratulations, you have purchased your home and can pick up the keys now</li></ul></div></div></li></ol><span class=\"line line--hori line--1\"></span><span class=\"line line--vert line--2\"></span><span class=\"line line--hori line--3\"></span><span class=\"line line--vert line--4\"></span><span class=\"line line--hori line--5\"></span><p class=\"advice__process-finish\"><span>Ready to move in</span></p></div></accordion-group></div></div><div class=\"advice-section\"><div class=\"advice-section__inner\"><accordion-group data-ng-class=\"{true:'active', false:''}[isOpen]\" data-is-open=\"accordionStates[1]\" class=\"advice__section advice__money\"><accordion-heading class=\"advice__section-heading\"><h3>The money</h3><i></i></accordion-heading><div class=\"grid\"><div class=\"grid__item three-fifths advice__money-screengrab\"><img ng-src=\"[[ STATIC_URL ]]images/advice-sections/mortgage-advice-widgets.ef9d016f.png\" alt=\"\"></div><div class=\"grid__item two-fifths advice__money-text\"><div class=\"advice__money-text-deposit\"><h4><i class=\"i sprite-icon-savings--blue\"></i>The Deposit</h4><p>Usually when you buy a property, youll need to put down a deposit. This amount depends on your financial situation, but to get the best mortgage deals, wed recommend aiming for 20-25% of the full price of the property. Our Affordability Calculator takes into account all the costs involved in buying a property, including stamp duty and other associated costs.</p></div><div class=\"advice__money-text-mortgage\"><h4><i class=\"i sprite-icon-bag--green\"></i>The Mortgage</h4><p>The mortgage amount is the amount of cash youll actually be borrowing. Aside from interest on the loan, this is the total amount you will be paying back to the bank over the mortgage term. Our Affordability Calculator will show you not only your mortgage amount, but also your monthly repayments, calculated using a standard interest rate over the lifetime of the mortgage.</p></div></div></div></accordion-group></div></div><div class=\"advice-section\"><div class=\"advice-section__inner\"><accordion-group data-ng-class=\"{true:'active', false:''}[isOpen]\" data-is-open=\"accordionStates[2]\" class=\"advice__section\"><accordion-heading class=\"advice__section-heading\"><h3>Lenders' affordability criteria</h3><i></i></accordion-heading><div class=\"grid\"><div class=\"grid__item one-half\"><p>When you're buying a home, mortgage lenders don't just look at your income, your assets and the down payment you're able to make. Your liabilities, monthly expenses and other obligations are important considerations as well. These may include car loans, credit card debts, child support payments, potential stamp duty and insurance premiums, as well as your overall credit rating. Our Affordability Calculator allows you to get a good idea how much of a mortgage you may be able to obtain. You can get a clear idea of your affordability with the three typical financial indicators, which the calculator assesses using a red-amber-green system.</p></div><div class=\"grid__item one-half\"><p><img ng-src=\"[[ STATIC_URL ]]images/advice-sections/mortgage-advice-indicators.831acfb1.png\" alt=\"\"></p></div></div><div class=\"grid advice__lenders-criteria__key\"><div class=\"grid__item one-third\"><div class=\"advice__lenders-criteria__key__item\"><i class=\"advice__lenders-criteria__key__icon key-icon__green\"></i><div class=\"advice__lenders-criteria__key__text\"><p>This area of your finances is fine. You shouldnt have any trouble getting a mortgage based on this criteria, as long as your credit file is in good shape. However, every situation is different, so be sure to check with a Mortgage Advisor.</p></div></div></div><div class=\"grid__item one-third\"><div class=\"advice__lenders-criteria__key__item\"><i class=\"advice__lenders-criteria__key__icon key-icon__yellow\"></i><div class=\"advice__lenders-criteria__key__text\"><p>You may have a little trouble finding a mortgage lender that will lend you the required amount on the right terms. However, a good Mortgage Advisor may be able to help you find a suitable mortgage.</p></div></div></div><div class=\"grid__item one-third\"><div class=\"advice__lenders-criteria__key__item\"><i class=\"advice__lenders-criteria__key__icon key-icon__red\"></i><div class=\"advice__lenders-criteria__key__text\"><p>This criteria breaches most lenders requirements, and as a result it may be difficult for you to find a loan for the required amount and term.</p></div></div></div></div></accordion-group></div></div><div class=\"advice-section\"><div class=\"advice-section__inner\"><accordion-group data-ng-class=\"{true:'active', false:''}[isOpen]\" data-is-open=\"accordionStates[3]\" class=\"advice__section advice__fees\"><accordion-heading class=\"advice__section-heading\"><h3>The fees</h3><i></i></accordion-heading><p>This is one of the most important and confusing areas of getting a mortgage. Understanding the costs of a mortgage is key to being able to accurately determine your purchasing power and choose the best product.</p><div class=\"grid advice__fees__content\"><div class=\"grid__item two-fifths advice__fees-left\"><div class=\"advice__fees-content-row advice__fees-content-row--pound\"><i class=\"i sprite-icon-blue-pound\"></i><h4>Annual Percentage (APR)</h4><p>APR, or annual percentage rate, is a single percentage value that allows you to compare the cost of a mortgage product. It takes into account not only the amount of interest, but also any other fees charged by the lender, such as arrangement fees for setting up a loan. Put simply, the lower the APR the better.</p></div><div class=\"advice__fees-content-row advice__fees-content-row--percent\"><i class=\"i sprite-icon-percent\"></i><h4>Interest</h4><p>Interest is the amount your lender charges you for borrowing money. This is based on the amount and the type of loan, as well as your credit risk as a borrower.</p></div></div><div class=\"grid__item three-fifths advice__fees-right\"><div data-pl-tabset=\"feesTabset\" data-pl-css-block-modifier=\"vertical\"><div data-pl-tab=\"\" data-pl-tab-title=\"Mortgage arrangement fee\"><p>A fee that can be bundled into the mortgage amount or paid separately. This is a basic admin charge factoring in the costs of your loan over the full term. These are usually only applicable to special-rate or discounted-rate mortgages.</p></div><div data-pl-tab=\"\" data-pl-tab-title=\"Valuation fee\"><p>The lender needs to know that the property is worth lending against, which means they have to commission a professional valuation. The borrower usually foots the bill for this.</p></div><div data-pl-tab=\"\" data-pl-tab-title=\"Mortgage account fee\"><p>This is a charge made by lenders to cover the costs of providing, maintaining and closing a mortgage.</p></div><div data-pl-tab=\"\" data-pl-tab-title=\"Higher lending charge\"><p>This is usually only applicable to those looking for a mortgage for a high percentage of the propertys full price. This fee is often used by lenders to take out insurance on repayments, so they dont lose out if you default.</p></div><div data-pl-tab=\"\" data-pl-tab-title=\"Remittance fee\"><p>This is the transfer fee charged by lenders for sending monies to your solicitor at completion.</p></div><div data-pl-tab=\"\" data-pl-tab-title=\"Early redemption fee\"><p>While there are lenders with mortgage products that do not charge this fee, in most cases you incur penalties for paying off your mortgage early. This will often come into play if youre moving mortgages or want to make one-off repayments. This usually applies to fixed-rate and discounted mortgages only.</p></div></div></div></div></accordion-group></div></div><div class=\"advice-section\"><div class=\"advice-section__inner\"><accordion-group data-ng-class=\"{true:'active', false:''}[isOpen]\" data-is-open=\"accordionStates[4]\" class=\"advice__section\"><accordion-heading class=\"advice__section-heading\"><h3>Repayment options</h3><i></i></accordion-heading><div class=\"advice__comparison-panels compare-two\"><div class=\"advice__comp-panel comp-panel\"><h4 class=\"comp-panel-heading comp-panel-heading--blue\">Repayment mortgages</h4><div class=\"comp-panel-body\"><p>These are often called capital and interest mortgages. This is the most common type of mortgage, where the monthly payments are made up of interest and the principle. These payments are constant from month-to-month, as long as the rate on your mortgage stays the same. Repayment mortgages are lower-risk options that ensure that by the end of the mortgage term, you will have paid off the entire mortgage, and the property will be fully yours.</p></div></div><div class=\"advice__comp-panel-vs-div advice__comp-panel-vs-div--blue-green\"></div><div class=\"advice__comp-panel comp-panel\"><h4 class=\"comp-panel-heading comp-panel-heading--green\">Interest-only mortgages</h4><div class=\"comp-panel-body\"><p>Interest-only mortgages allow borrowers to pay off just the interest on the amount borrowed. This means that you will eventually need to repay the money you originally borrowed. While it might be advantageous in low-interest rate environments, it is a high-risk option, usually taken by speculative property buyers.</p></div></div></div></accordion-group></div></div><div class=\"advice-section\"><div class=\"advice-section__inner\"><accordion-group data-ng-class=\"{true:'active', false:''}[isOpen]\" data-is-open=\"accordionStates[5]\" class=\"advice__section advice__types\"><accordion-heading class=\"advice__section-heading\"><h3>Types of mortgages</h3><i></i></accordion-heading><div data-pl-tabset=\"mortgageTypesTabset\" data-pl-css-block-modifier=\"main\"><div data-pl-tab=\"\" data-pl-tab-title=\"Fixed Rate\"><div class=\"advice__types__icon\"><i class=\"sprite-icon-mortgage-advice-type-fixed-rate\"></i></div><div class=\"advice__types__text\"><p>A fixed-rate mortgage offers a fixed interest rate for between 2 and 5 years. At the end of this introductory rate, your lenders standard variable rate is used.</p><h4>Consider this type of loan</h4><ol><li>If you find a low fixed rate mortgage in comparison to the tracker mortgages</li><li>If youre averse to risk and feel more comfortable with unchanging payments</li><li>You believe that interest rates are more likely to go up than down in the future</li></ol><h4>What to ask your advisor</h4><ol><li>If interest rates drop significantly, how would I refinance this loan and what are the associated costs?</li><li>What is the risk of not remortgaging after the fixed term expires?</li></ol></div></div><div data-pl-tab=\"\" data-pl-tab-title=\"Tracker\"><div class=\"advice__types__icon\"><i class=\"sprite-icon-mortgage-advice-type-tracker\"></i></div><div class=\"advice__types__text\"><p>Tracker mortgages usually follow the Bank of Englands base rate. Therefore, if interest rates increase by 1%, your mortgage rate will too.</p><h4>Consider this type of loan</h4><ol><li>If you can secure a very low rate of interest</li><li>If you believe that Bank of Englands base rate is not likely to increase in the near future</li><li>If you prefer the idea of a more stable rate of interest, not subject to your lenders SVR</li></ol><h4>What to ask your advisor</h4><ol><li>If the base rate rises significantly, how would I refinance this loan and what are the associated costs?</li><li>Is this the right mortgage if I am on a tight budget and need to know exactly how much my monthly mortgage repayments will be?</li></ol></div></div><div data-pl-tab=\"\" data-pl-tab-title=\"Standard Variable\"><div class=\"advice__types__icon\"><i class=\"sprite-icon-mortgage-advice-type-standard-variable\"></i></div><div class=\"advice__types__text\"><p>With a standard variable-rate mortgage, your payments change based on the lenders standard variable rate (SVR). In most cases, rather than buying a SVR product, you find yourself in this kind of deal after the introductory term on your fixed-rate product runs out.</p><h4>Consider this type of loan</h4><ol><li>If you find it very difficult to remortgage to another product due to changes in your financial situation</li><li>If your previous mortgage deal has come to an end and you have been transferred onto a low SVR. While its not very common, your current lender might offer an attractive SVR in order not to lose business to competitors</li></ol><h4>What to ask your advisor</h4><ol><li>How do SVRs compare to tracker mortgages?</li><li>Will the lender always pass on changes in the Bank of England base rate to me, even if rates go down?</li><li>Can the lender increase the SVR, even if the Bank of England does not increase rates?</li><li>I am on a SVR currently. Should I remortgage now?</li></ol></div></div><div data-pl-tab=\"\" data-pl-tab-title=\"Capped Rate\"><div class=\"advice__types__icon\"><i class=\"sprite-icon-mortgage-advice-type-capped-rate\"></i></div><div class=\"advice__types__text\"><p>With capped-rate mortgages, you will be on the lenders SVR unless it hits your cap. Any further increase in the interest rate after this point wont affect your mortgage rate. This type of mortgage usually has a specified period of capping.</p><h4>Consider this type of loan</h4><ol><li>If you want the security of an upper limit to your interest rates.</li><li>If you think interest rates are set to skyrocket.</li></ol><h4>What to ask your advisor</h4><ol><li>What will happen to the rate after the specified period?</li><li>Can I get a longer capping period?</li><li>Why dont I see more of these capped-rate mortgage products around?</li></ol></div></div><div data-pl-tab=\"\" data-pl-tab-title=\"Discount Rate\"><div class=\"advice__types__icon\"><i class=\"sprite-icon-mortgage-advice-type-discount-rate\"></i></div><div class=\"advice__types__text\"><p>In most cases discount-rate mortgages are just fixed-rate mortgages with attractive initial rates. Think of them as special offers from lenders to win new business. The discount period usually lasts 2 to 5 years and will then revert to the SVR.</p><h4>Consider this type of loan</h4><ol><li>If youre a bargain hunter looking for a good deal.</li><li>If you know youre going to remember to remortgage once the discount term expires.</li></ol><h4>What to ask your advisor</h4><ol><li>Even with the low initial rate, is this the best overall mortgage for me?</li><li>Is the discount fixed or linked to a SVR? How high can my discount rate go?</li><li>What are my remortgaging options once this deal runs out?</li></ol></div></div><div data-pl-tab=\"\" data-pl-tab-title=\"Offset\"><div class=\"advice__types__icon\"><i class=\"sprite-icon-mortgage-advice-type-offset\"></i></div><div class=\"advice__types__text\"><p>Offset loans consider all your finances, including current accounts, savings accounts and other personal loans. Your lender calculates your net worth on a daily basis and offsets your assets against your loans, which includes your mortgage.</p><h4>Consider this type of mortgage</h4><ol><li>If you have additional money sitting in a savings account.</li><li>If you pay a high rate of tax. With offset mortgages, you dont pay tax on savings.</li></ol><h4>What to ask your advisor</h4><ol><li>How much more interest am I likely to be paying over the full term, compared to other types of mortgage?</li><li>Are there variable and fixed options? How do they stack up against other deals?</li><li>What kind of sum do I need saved to make an offset mortgage worthwhile?</li></ol></div></div></div></accordion-group></div></div><div class=\"advice-section\"><div class=\"advice-section__inner\"><accordion-group data-ng-class=\"{true:'active', false:''}[isOpen]\" data-is-open=\"accordionStates[6]\" class=\"advice__section\"><accordion-heading class=\"advice__section-heading\"><h3>Get award winning, independent &amp; impartial mortgage advice</h3><i></i></accordion-heading><div class=\"grid\"><div class=\"grid__item two-thirds\"><ul><li>A dedicated mortgage advisor to help you through the process.</li><li>Whole of the market access to thousands of mortgage deals.</li><li>Someone who handles all the paperwork and liaises direct with your lender, saving you time &amp; work.</li><li>Regular updates about your application every step of the way.</li><li>Explaining the pros and cons of each product in a simple, jargon free manner.</li><li>Extensive knowledge of the market.</li></ul></div><div class=\"grid__item one-third\"><img data-ng-src=\"[[ STATIC_URL ]]images/partner-assets/mortgage-advisor-logo.81b3ba57.png\" class=\"advice-section__image\"><div class=\"yellow-box\"><p>Your home may be repossessed if you do not keep up repayments on your mortgage.</p><p>A fee of up to 1% of the mortgage amount may be charged depending on individual circumstances. A typical fee is &pound;495.</p></div><p><small class=\"smaller\">MAB 4884</small></p></div></div></accordion-group></div></div></accordion><div class=\"advice-section advice-section--complete\"><div class=\"advice-section__inner\"><div class=\"line line--hori\"></div><button class=\"contact-button contact-button--mortgage-advisor--grey\" data-ng-click=\"openDialog('mortgageAdvisor')\"><span class=\"i\"></span>Speak to a Mortgage Advisor</button></div></div></div>");
