    $templateCache.put("/partials/views/property-coach/property-coach.html", "<div class=\"page-content page-content--property-coach\"><div class=\"advice-section advice-section--intro\"><div class=\"advice-section__inner\"><h1>Property Coach</h1><p>Having a Property Coach on your side for some or all of your homebuying journey can help you feel more confident about your decisions. Theyll be there to answer your questions and save you time, stress and money. Read on to find out more about what they can do for you.</p></div></div><accordion class=\"advice__sections\" data-close-others=\"false\"><div class=\"advice-section\"><div class=\"advice-section__inner\"><div class=\"advice__section\"><div class=\"accordion-body\"><div class=\"grid\"><div class=\"grid__item three-fifths\"><div class=\"accordion-heading\"><h3>What is a Property Coach?</h3></div><div class=\"accordion-inner\"><p>Property Coaches are experts dedicated to finding and securing your perfect property. You can hire them for any part of the rental and homebuying journey and they can advise you on anything from sourcing properties to writing an offer letter and negotiating a price. The great thing about Property Coaches is that theyre 100 per cent there for you. Unlike estate agents, they offer completely impartial advice saving you time and money.</p></div></div><div class=\"grid__item two-fifths\"><img ng-src=\"[[ STATIC_URL ]]images/advice-sections/property-coach-photos.7e044a54.jpg\" alt=\"\"></div></div></div></div></div></div><div class=\"advice-section\"><div class=\"advice-section__inner\"><accordion-group data-ng-class=\"{true:'active', false:''}[isOpen]\" data-is-open=\"accordionStates[0]\" class=\"advice__section\"><accordion-heading class=\"advice__section-heading\"><h3>What is the process using a Property Coach?</h3><i></i></accordion-heading><div class=\"advice__process\"><p class=\"advice__process-start\"><span>Start of Property Coach Process</span></p><ol><li class=\"item item1\"><span class=\"number\">1</span><div class=\"content content--align-top\"><span>Free, no obligation meeting or call</span><div class=\"content-popup\"></div></div></li><li class=\"item item2\"><span class=\"number\">2</span><div class=\"content content--align-top\"><span>Comprehensive buyer and property brief</span><div class=\"content-popup\"></div></div></li><li class=\"item item3\"><span class=\"number\">3</span><div class=\"content content--align-top\"><span>Orientation tour of selected areas</span><div class=\"content-popup\"></div></div></li><li class=\"item item4\"><span class=\"number\">4</span><div class=\"content\"><span>Property search by Property Coach</span><div class=\"content-popup\"></div></div></li><li class=\"item item5\"><span class=\"number\">5</span><div class=\"content\"><span>Report to your shortlist</span><div class=\"content-popup\"></div></div></li><li class=\"item item6\"><span class=\"number\">6</span><div class=\"content\"><span>Arrange viewings with you</span><div class=\"content-popup\"></div></div></li><li class=\"item item7 item--line-overlay\"><span class=\"number\">7</span><div class=\"content\"><span>Negotiate on your behalf</span><div class=\"content-popup\"></div></div></li><li class=\"item item8\"><span class=\"number\">8</span><div class=\"content\"><span>Manage legal process</span><div class=\"content-popup\"></div></div></li><li class=\"item item9\"><span class=\"number\">9</span><div class=\"content\"><span>Help to settle in</span><div class=\"content-popup\"></div></div></li></ol><span class=\"line line--hori line--1\"></span><span class=\"line line--vert line--2\"></span><span class=\"line line--hori line--3\"></span><span class=\"line line--vert line--4\"></span><span class=\"line line--hori line--5\"></span><p class=\"advice__process-finish\"><span>Ready to move in</span></p></div></accordion-group></div></div><div class=\"advice-section\"><div class=\"advice-section__inner\"><accordion-group data-ng-class=\"{true:'active', false:''}[isOpen]\" data-is-open=\"accordionStates[1]\" class=\"advice__section advice__types\"><accordion-heading class=\"advice__section-heading\"><h3>How can a Property Coach help me?</h3><i></i></accordion-heading><div data-pl-tabset=\"propertyCoachHelp\" data-pl-css-block-modifier=\"main\"><div data-pl-tab=\"\" data-pl-tab-title=\"Expert in property buying\"><div class=\"advice__types__icon\"><i class=\"sprite-icon-property-coach-type-expert\"></i></div><div class=\"advice__types__text\"><p>Property coaches are true experts in the property market and know everything there is to know about locations, prices and the buying process. Whats more they take the time to get to know your situation, which allows them to identify areas and properties based on your criteria, such as commuting distance and proximity to schools.</p><p>Property Coaches have a large network of estate agents and regularly get access to properties that are coming to market before theyre made available to the general public. If youre looking for development opportunities, they can not only source targets, but also help you find an appropriate architect, builder and other tradesmen for the task.</p><p>For a smooth homebuying journey and peace of mind, a Property Coach is probably the best way to go. Theyll not only shortlist and preview potential properties for you, but theyll also give you a clear evaluation of things like security, local planning policies, transport links and buildings reports.</p></div></div><div data-pl-tab=\"\" data-pl-tab-title=\"Master of negotiation\"><div class=\"advice__types__icon\"><i class=\"sprite-icon-property-coach-type-master\"></i></div><div class=\"advice__types__text\"><p>Coming up with a fair price estimate is more art than science. If your offer and negotiation process is not managed well, the price may end up far away from the fair value of the property.</p><p>Property coaches also give you the upper hand in negotiations. have built a sense of prices They do all the information gathering and background checks on properties, so you dont have to. Theyll also handle the negotiations for you. This can save you a fortune if youre not someone whos particularly confident with money matters.</p><p>Simply having a Property Coach can speed up the process, as sellers and agents know from experience that buyers with Property Coaches are serious and are not going to be bullied or out-negotiated. In fact, in most cases hiring a Property Coach saves you money over the course of your homebuying journey, so its always worth looking into.</p></div></div><div data-pl-tab=\"\" data-pl-tab-title=\"Someone you can trust &amp; actually talk to\"><div class=\"advice__types__icon\"><i class=\"sprite-icon-property-coach-type-trust\"></i></div><div class=\"advice__types__text\"><p>Being able to trust someone thats solely looking out for your interests can often make the difference between a smooth homebuying journey and a tumultuous nightmare. Having someone there thats got concrete answers to your questions makes it easier for you to feel confident in your decisions.</p><p>A Property Coach acts as a single point of contact and gives you a completely bespoke service. They know that every buyer is different, so they take the time to get to know you before helping you through the process, from dealing with complex paperwork to settling in to your new community.</p></div></div></div></accordion-group></div></div><div class=\"advice-section\"><div class=\"advice-section__inner\"><accordion-group data-ng-class=\"{true:'active', false:''}[isOpen]\" data-is-open=\"accordionStates[2]\" class=\"advice__section advice__property-coach-get-started\"><accordion-heading class=\"advice__section-heading\"><h3>How can I get started?</h3><i></i></accordion-heading><div class=\"grid\"><div class=\"grid__item two-thirds\"><div class=\"property-coach-get-started__option-panels\"><div class=\"property-coach-get-started__panel property-coach-get-started__panel--orientation\"><h4 class=\"property-coach-get-started__panel__header\">Not ready to buy yet?</h4><div class=\"property-coach-get-started__panel__body\"><h3>The Rental</h3><p>Stress free rental search</p><div class=\"property-coach-get-started__panel__num-wrap\"><div class=\"number\"><span>&pound;</span>495</div><span class=\"number-label\">Retainer fee</span></div><div class=\"property-coach-get-started__panel__num-wrap\"><div class=\"number number-text\">1 month rent</div><span class=\"number-label\">Success fee</span></div></div><div class=\"property-coach-get-started__panel__footer\"><a href=\"#\" data-ng-click=\"openDialog('propertyCoachOrientation')\">Get more info</a></div></div><div class=\"property-coach-get-started__panel-div\"><div class=\"property-coach-get-started__panel-div__icon-wrap\"><i></i></div></div><div class=\"property-coach-get-started__panel property-coach-get-started__panel--unlimited\"><h4 class=\"property-coach-get-started__panel__header\">Ready to buy a property!</h4><div class=\"property-coach-get-started__panel__body\"><h3>The Purchase</h3><p>3 months, unlimited properties</p><div class=\"property-coach-get-started__panel__num-wrap\"><div class=\"number\"><span>&pound;</span>495</div><span class=\"number-label\">Retainer fee</span></div><div class=\"property-coach-get-started__panel__num-wrap\"><div class=\"number\">1.5%</div><span class=\"number-label\">Success fee</span></div></div><div class=\"property-coach-get-started__panel__footer\"><a href=\"#\" data-ng-click=\"openDialog('propertyCoachUnlimited')\">Get more info</a></div></div></div></div><div class=\"grid__item one-third property-coach-get-started__aside-info\"><h4>Every Property Coach is</h4><ul><li>An expert in property buying</li><li>Master of negotiation</li><li>Someone you can trust and actually talk to</li></ul><h4>Our Commintment to You</h4><ul><li>Stress Free. Guaranteed</li><li>Unlimited access</li><li>White glove treatment</li><li>No conflicts</li></ul></div></div></accordion-group></div></div></accordion><div class=\"advice-section advice-section--complete\"><div class=\"advice-section__inner\"><div class=\"line line--hori\"></div><h2>Our Property Coach will Find Your Dream Home</h2><button class=\"contact-button contact-button--property-coach\" data-ng-click=\"openDialog('propertyCoach')\"><span class=\"i\"></span>Speak to a Property Coach</button></div></div></div>");
